import React from "react";
import { useParams } from "react-router-dom";
import { collegeData } from "../data/collegedata";

const CollegeListPage = () => {
  const { stream } = useParams();
  const colleges = collegeData[stream] || [];

  // Placeholder functions for buttons
  const handleApplyClick = (collegeName) => {
    console.log(`Apply Now clicked for: ${collegeName}`);
    // You can navigate to an enrollment form or open a modal
  };

  const handleDetailsClick = (collegeName) => {
    console.log(`Get Details clicked for: ${collegeName}`);
    // You can navigate to a detailed page for the college
  };

  return (
    <div style={{ padding: "20px" }}>
      <h1>{stream} Colleges</h1>
      {colleges.length === 0 ? (
        <p>No colleges found for this stream.</p>
      ) : (
        <ul style={{ listStyle: "none", padding: 0 }}>
          {colleges.map((college, idx) => (
            <li
              key={idx}
              style={{
                border: "1px solid #ccc",
                padding: "10px",
                marginBottom: "10px",
                borderRadius: "5px",
              }}
            >
              <div>
                <strong>{college.name}</strong> - {college.city}
              </div>
              <div style={{ marginTop: "10px" }}>
                <button
                  style={{ marginRight: "10px" }}
                  onClick={() => handleDetailsClick(college.name)}
                >
                  Get Details
                </button>
                <button onClick={() => handleApplyClick(college.name)}>
                  Apply Now
                </button>
              </div>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default CollegeListPage;
